  name: ChatSessionEntity
  nameWithType: ChatSessionEntity
  fullName: SuperOffice.CRM.Services.ChatSessionEntity
  type: Class
  source:
    path: SuperOffice.Services
    isExternal: true
  assemblies:
  - SuperOffice.Services
  namespace: SuperOffice.CRM.Services
  summary: "\nChat sessions belong to a chat topic, and contain messages to/from users\n<p></p>\nCarrier object for ChatSessionEntity.\nServices for the ChatSessionEntity Carrier is available from the <xref href=\"SuperOffice.CRM.Services.IChatAgent\" data-throw-if-not-resolved=\"false\"></xref>.\n"
  example:
  - "\nGet ChatSessionEntity 123 using the agent:\n<pre><code> using SuperOffice;\n using SuperOffice.CRM.Services;\n\n using (SoSession mySession = SoSession.Authenticate(&quot;user&quot;, &quot;pass&quot;))\n {\n    var agent = new ChatAgent();\n    var chatSessionEntity = agent.GetChatSessionEntity( 123 );\n }</code></pre>\n\nFind all ChatSessionEntity, get related items using archive agent.\n<pre><code>var archive = new ArchiveAgent();\nvar rows = archive.GetArchiveListByColumns2(&quot;ChatSession&quot;, &quot;...&quot;, null, &quot;getAllRows eq 1&quot;, null, 0, 100 );</code></pre>\n"
  syntax:
    content: 'public class ChatSessionEntity : Carrier'
    content.vb: >-
      Public Class ChatSessionEntity

          Inherits Carrier
